import { lazy } from 'react'

// ** Document title
const TemplateTitle = '%s - Transport Permits Identification System'

// ** Default Route
const DefaultRoute = '/home'

// ** Merge Routes
const Routes = [
  {
    path: '/home',
    component: lazy(() => import('../../views/Home'))
  },
  {
    path: '/second-page',
    component: lazy(() => import('../../views/SecondPage'))
  },
  {
    path: '/sgsoil',
    component: lazy(() => import('../../views/Sgsoil'))
  },
  {
    path: '/sgsoil',
    component: lazy(() => import('../../views/Sgsoil'))
  },
  {
    path: '/timwood',
    component: lazy(() => import('../../views/Timwood'))
  },
  {
    path: '/login',
    component: lazy(() => import('../../views/Login')),
    layout: 'BlankLayout',
    meta: {
      authRoute: true
    }
  },
  {
    path: '/register',
    component: lazy(() => import('../../views/Register')),
    layout: 'BlankLayout',
    meta: {
      authRoute: true
    }
  },
  {
    path: '/error',
    component: lazy(() => import('../../views/Error')),
    layout: 'BlankLayout'
  },
  {
    path: '/forgot-password',
    component: lazy(() => import('../../views/ForgotPassword')),
    layout: 'BlankLayout'
  },
  {
    path: '/reset-password',
    component: lazy(() => import('../../views/ResetPassword')),
    layout: 'BlankLayout'
  },
  {
    path: '/two-steps',
    component: lazy(() => import('../../views/TwoSteps')),
    layout: 'BlankLayout'
    },
    {
    path: '/verify-email',
    component: lazy(() => import('../../views/VerifyEmail')),
    layout: 'BlankLayout'
    }
]

export { DefaultRoute, TemplateTitle, Routes }
